import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Homepage from './Homepage';
import RSAEncryption from './RSA';
import './RSA.css';

const App: React.FC = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Homepage />} /> {/* Trang chủ */}
                <Route path="/rsa" element={<RSAEncryption />} /> {/* Trang RSA */}
            </Routes>
        </Router>
    );
};

export default App;
